{/* Connections (drawn behind components) */}
<ConnectionLayer mapToSVGCoords={mapToSVGCoords} />

{/* Components */}
{components.map(component => {
  const isSelected = component.id === selectedId
  const isDraggingThis = dragState.isDragging && dragState.componentId === component.id
  const isConnectionStart = connectionStart === component.id
  const isConnectionTarget = isConnecting && connectionStart !== component.id

  // Use drag position if dragging, otherwise use component position
  const svgCoords = isDraggingThis 
    ? dragState.currentPos
    : mapToSVGCoords(component.x, component.y)

  return (
    <g key={component.id}>
      {/* Component circle */}
      <circle
        cx={svgCoords.x}
        cy={svgCoords.y}
        r={isDraggingThis ? "28" : (isConnectionStart ? "30" : "25")}
        fill={component.color}
        stroke={
          isConnectionStart ? '#F59E0B' : 
          isConnectionTarget ? '#10B981' :
          isSelected ? '#3B82F6' : '#374151'
        }
        strokeWidth={isSelected || isConnectionStart ? 3 : 2}
        style={{ 
          cursor: isConnecting ? 'crosshair' : (isDraggingThis ? 'grabbing' : 'grab'),
          opacity: isDraggingThis ? 0.8 : (isConnectionTarget ? 0.9 : 1),
          filter: isDraggingThis ? 'url(#dropShadow)' : 'none',
          transition: isDraggingThis ? 'none' : 'all 0.2s ease'
        }}
        onMouseDown={(e) => handleComponentMouseDown(e, component.id)}
        onContextMenu={(e) => handleComponentRightClick(e, component.id)}
      />

      {/* Component label */}
      <text
        x={svgCoords.x}
        y={svgCoords.y + 5}
        textAnchor="middle"
        fill="white"
        fontSize={isDraggingThis ? "13" : "12"}
        fontWeight="600"
        style={{ 
          pointerEvents: 'none', 
          userSelect: 'none',
          filter: isDraggingThis ? 'url(#dropShadow)' : 'none'
        }}
      >
        {component.name}
      </text>

      {/* Selection indicator */}
      {isSelected && !isDraggingThis && !isConnectionStart && (
        <circle
          cx={svgCoords.x}
          cy={svgCoords.y}
          r="30"
          fill="none"
          stroke="#3B82F6"
          strokeWidth="2"
          strokeDasharray="5,5"
          style={{ pointerEvents: 'none' }}
        >
          <animateTransform
            attributeName="transform"
            attributeType="XML"
            type="rotate"
            from={`0 ${svgCoords.x} ${svgCoords.y}`}
            to={`360 ${svgCoords.x} ${svgCoords.y}`}
            dur="3s"
            repeatCount="indefinite"
          />
        </circle>
      )}

      {/* Connection start indicator */}
      {isConnectionStart && (
        <circle
          cx={svgCoords.x}
          cy={svgCoords.y}
          r="35"
          fill="none"
          stroke="#F59E0B"
          strokeWidth="3"
          strokeDasharray="8,4"
          style={{ pointerEvents: 'none' }}
        >
          <animateTransform
            attributeName="transform"
            attributeType="XML"
            type="rotate"
            from={`0 ${svgCoords.x} ${svgCoords.y}`}
            to={`360 ${svgCoords.x} ${svgCoords.y}`}
            dur="1.5s"
            repeatCount="indefinite"
          />
        </circle>
      )}

      {/* Connection target indicator */}
      {isConnectionTarget && (
        <circle
          cx={svgCoords.x}
          cy={svgCoords.y}
          r="32"
          fill="none"
          stroke="#10B981"
          strokeWidth="2"
          strokeDasharray="4,4"
          style={{ pointerEvents: 'none' }}
        />
      )}

      {/* Drag position indicator */}
      {isDraggingThis && (
        <g>
          {/* Position info */}
          <rect
            x={svgCoords.x - 40}
            y={svgCoords.y - 50}
            width="80"
            height="20"
            fill="rgba(0,0,0,0.8)"
            rx="4"
          />
          <text
            x={svgCoords.x}
            y={svgCoords.y - 37}
            textAnchor="middle"
            fill="white"
            fontSize="10"
            fontWeight="500"
          >
            {getEvolutionStage(component.x)}
          </text>
        </g>
      )}
    </g>
  )
})}

