          filter: isDraggingThis ? 'url(#dropShadow)' : 'none'
        }}
      >
        {component.name}
      </text>

      {/* Selection indicator */}
      {isSelected && !isDraggingThis && (
        <circle
          cx={svgCoords.x}
          cy={svgCoords.y}
          r="30"
          fill="none"
          stroke="#3B82F6"
          strokeWidth="2"
          strokeDasharray="5,5"
          style={{ pointerEvents: 'none' }}
        >
          <animateTransform
            attributeName="transform"
            attributeType="XML"
            type="rotate"
            from={`0 ${svgCoords.x} ${svgCoords.y}`}
            to={`360 ${svgCoords.x} ${svgCoords.y}`}
            dur="3s"
            repeatCount="indefinite"
          />
        </circle>
      )}

      {/* Drag position indicator */}
      {isDraggingThis && (
        <g>
          {/* Position info */}
          <rect
            x={svgCoords.x - 40}
            y={svgCoords.y - 50}
            width="80"
            height="20"
            fill="rgba(0,0,0,0.8)"
            rx="4"
          />
          <text
            x={svgCoords.x}
            y={svgCoords.y - 37}
            textAnchor="middle"
            fill="white"
            fontSize="10"
            fontWeight="500"
          >
            {getEvolutionStage(component.x)}
          </text>
        </g>
      )}
    </g>
  )
})}

