import { MapComponent, MapConnection } from '../stores/mapStore'

export interface ExportData {
  components: MapComponent[]
  connections: MapConnection[]
  metadata: {
    title: string
    createdAt: string
    exportedAt: string
    version: string
  }
}

export class ExportService {
  // Export as PNG image
  static async exportToPNG(canvasElement: SVGSVGElement, filename: string = 'wardley-map.png') {
    try {
      // Create a temporary container with white background
      const container = document.createElement('div')
      container.style.position = 'absolute'
      container.style.left = '-9999px'
      container.style.top = '-9999px'
      container.style.width = '1200px'
      container.style.height = '800px'
      container.style.backgroundColor = 'white'
      container.style.padding = '20px'

      // Clone the SVG
      const svgClone = canvasElement.cloneNode(true) as SVGSVGElement
      svgClone.style.width = '1160px'
      svgClone.style.height = '760px'

      container.appendChild(svgClone)
      document.body.appendChild(container)

      // Convert to canvas
      const canvas = await html2canvas(container, {
        backgroundColor: 'white',
        scale: 2, // Higher resolution
        useCORS: true,
        allowTaint: true
      })

      // Clean up
      document.body.removeChild(container)

      // Convert to blob and download
      canvas.toBlob((blob) => {
        if (blob) {
          saveAs(blob, filename)
        }
      }, 'image/png')

      return true
    } catch (error) {
      console.error('PNG export failed:', error)
      return false
    }
  }

  // Export as PDF
  static async exportToPDF(canvasElement: SVGSVGElement, filename: string = 'wardley-map.pdf') {
    try {
      // Create a temporary container
      const container = document.createElement('div')
      container.style.position = 'absolute'
      container.style.left = '-9999px'
      container.style.top = '-9999px'
      container.style.width = '1200px'
      container.style.height = '800px'
      container.style.backgroundColor = 'white'
      container.style.padding = '20px'

      // Clone the SVG
      const svgClone = canvasElement.cloneNode(true) as SVGSVGElement
      svgClone.style.width = '1160px'
      svgClone.style.height = '760px'

      container.appendChild(svgClone)
      document.body.appendChild(container)

      // Convert to canvas
      const canvas = await html2canvas(container, {
        backgroundColor: 'white',
        scale: 2,
        useCORS: true,
        allowTaint: true
      })

      // Clean up
      document.body.removeChild(container)

      // Create PDF
      const pdf = new jsPDF({
        orientation: 'landscape',
        unit: 'mm',
        format: 'a4'
      })

      const imgData = canvas.toDataURL('image/png')
      const imgWidth = 297 // A4 landscape width in mm
      const imgHeight = (canvas.height * imgWidth) / canvas.width

      pdf.addImage(imgData, 'PNG', 0, 0, imgWidth, imgHeight)
      pdf.save(filename)

      return true
    } catch (error) {
      console.error('PDF export failed:', error)
      return false
    }
  }

  // Export as Draw.io XML
  static exportToDrawIO(data: ExportData, filename: string = 'wardley-map.drawio') {
    try {
      const xml = this.generateDrawIOXML(data)
      const blob = new Blob([xml], { type: 'application/xml' })
      saveAs(blob, filename)
      return true
    } catch (error) {
      console.error('Draw.io export failed:', error)
      return false
    }
  }

  // Export as JSON
  static exportToJSON(data: ExportData, filename: string = 'wardley-map.json') {
    try {
      const json = JSON.stringify(data, null, 2)
      const blob = new Blob([json], { type: 'application/json' })
      saveAs(blob, filename)
      return true
    } catch (error) {
      console.error('JSON export failed:', error)
      return false
    }
  }

