import React, { useRef, useCallback, useState, useEffect, forwardRef } from 'react'
import { useMapStore } from '../stores/mapStore'
import ConnectionLayer from './ConnectionLayer'

interface DragState {
  componentId: string | null
  isDragging: boolean
  startPos: { x: number, y: number }
  offset: { x: number, y: number }
  currentPos: { x: number, y: number }
}

const Canvas = forwardRef<SVGSVGElement>((props, ref) => {
  const svgRef = useRef<SVGSVGElement>(null)
  const [dragState, setDragState] = useState<DragState>({
    componentId: null,
    isDragging: false,
    startPos: { x: 0, y: 0 },
    offset: { x: 0, y: 0 },
    currentPos: { x: 0, y: 0 }
  })

  const { 
    components, 
    selectedId, 
    selectComponent, 
    updateComponent,
    startDrag,
    endDrag,
    isDragging: storeIsDragging,
    // Connection state
    isConnecting,
    connectionStart,
    startConnection,
    completeConnection,
    cancelConnection
  } = useMapStore()

  // Combine refs
  React.useImperativeHandle(ref, () => svgRef.current!)

  // Convert screen coordinates to map coordinates (0-1 scale)
  const screenToMapCoords = useCallback((screenX: number, screenY: number) => {
    if (!svgRef.current) return { x: 0, y: 0 }

    const rect = svgRef.current.getBoundingClientRect()
    const x = (screenX - rect.left) / rect.width
    const y = (screenY - rect.top - 50) / 500 // Account for axis offset and canvas height

    return {
      x: Math.max(0, Math.min(1, x)),
      y: Math.max(0, Math.min(1, y))
    }
  }, [])

  // Convert map coordinates to SVG coordinates
  const mapToSVGCoords = useCallback((mapX: number, mapY: number) => {
    return {
      x: mapX * 1000,
      y: mapY * 500 + 50 // Account for axis offset
    }
  }, [])

